;; **
;;; That looks promising. We are now in a position to implement a function to generate the initial population. We'll include a range of tree sizes for variety.
;; **

;; @@
(defn make-initial-population
  [n max-depth]
  (repeatedly n #(random-full-tree functions terminals (+ 1 (rand-int (- max-depth 1))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/make-initial-population</span>","value":"#'user/make-initial-population"}
;; <=

;; **
;;; ## Scoring the solutions
;; **

;; **
;;; We'll use a modified @@\chi^2@@ type score to indicate how well each proposed solution fits. Rather than squaring the residuals, as in a @@\chi^2@@ score, we'll use the absolute values:
;;; 
;;; $$ S(f) = \sum_{i} |f(x_i) - y_i| $$
;;; 
;;; where @@i@@ runs over the data points, @@f@@ is the function under test and @@(x_i, y_i)@@ is the @@i@@th data point. This form of the scoring function is commonly used, and less aggressive for functions that are way off the mark. I've never tested whether it really makes any difference to the convergence of the genetic algorithm search though.
;;; 
;;; So that we have something concrete to play with, let's make up a target dataset. We'll start with something simple, a sine curve with noise.
;; **

;; @@
(def data (map (fn [x] [x (+ (Math/sin (* 6 x)) (rand 0.2))]) (range 0 1 0.05)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/data</span>","value":"#'user/data"}
;; <=

;; @@
(list-plot data)
