;; **
;;; The score function itself is easy to implement.
;; **

;; @@
(defn score
  [data ex]
  (apply + (map #(Math/abs (- ((functionalise ex 'x) (first %)) (second %))) data)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/score</span>","value":"#'user/score"}
;; <=

;; **
;;; Let's check this makes sense by looking at a few random functions and their scores.
;; **

;; @@
