;; **
;;; That looks like it does kind of the right thing - the curves that lie closer to the data have lower scores.
;;; 
;;; ## Genetic operations
;;; 
;;; The final ingredient we need before we can pull it all together is a way to make new expressions from existing ones.
;;; 
;;; The first mechanism for doing this is mutation. There are a number of ways of doing this, and as usual we'll go for something simple. First up, some helpers. We'll want to be able to act on a randomly chosen part of a tree. We'll specify a location in a tree by numbering the nodes, following a depth-first walk. The first helper gives us the total number of nodes in the tree.
;; **

;; @@
(defn count-nodes
  [ex]
  (if (seq? ex)
  	(+ 1 (apply + (map count-nodes (rest ex))))
    1))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/count-nodes</span>","value":"#'user/count-nodes"}
;; <=

;; **
;;; And the second helper replaces a part of the tree, specified by its depth-first index, with another given tree. We'll use the `clojure.zip` library to do the tree manipulation. We define a zipper-constructor for expressions, that will treat the expression in the way we'd expect (namely, that branch nodes are functions). You might need to revise the `clojure.zip` documentation to make sense of this function.
;; **

;; @@
(defn expr-zip
  [expr]
  (zip/zipper
    (constantly true)
    (fn [node] (if (seq? node) (rest node) nil))
    (fn [node children] (with-meta (conj children (first node)) (meta node)))
    expr))
 
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/expr-zip</span>","value":"#'user/expr-zip"}
;; <=

;; **
;;; With a zipper implementation for our expressions, we can now easily define our `tree-replace` function. We simply walk the tree to the target index, and then replace the sub-tree with the new tree.
;; **

;; @@
(defn tree-replace
  [tree index new-tree]
  (let [subtree-z (nth (iterate zip/next (expr-zip tree)) index)
        new-zipper (zip/replace subtree-z new-tree)]
    (zip/root new-zipper)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/tree-replace</span>","value":"#'user/tree-replace"}
;; <=

;; **
;;; An example of it in action:
;; **

;; @@
(tree-replace '(+ 1 (* 3 4 5)) 4 '(+ 1 1))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>(+ 1 (* 3 (+ 1 1) 5))</span>","value":"(+ 1 (* 3 (+ 1 1) 5))"}
;; <=

;; **
;;; With that out of the way we're in the position to implement our mutation function. We'll take a function as a parameter that constructs the new tree fragment.
;; **

;; @@
(defn mutate-expr
  [expr new-tree-func]
  (let [size (count-nodes expr)
        target (rand-int size)]
    (tree-replace expr target (new-tree-func))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/mutate-expr</span>","value":"#'user/mutate-expr"}
;; <=

;; **
;;; And a check that it works. You might want to play with calling the function below a few times.
